import SignInScreen from './Screens/SignInScreen';
import HomeScreen from './Screens/HomeScreen';
import './App.css';

function App() {
  const [isSignedIn,setIsSignedIn] = useState(false);
  return (
    <>
      {isSignedIn === true?
        <HomeScreen/>
        :
        <SignInScreen/>
      }
    </>
  );
}

export default App;
